import AppLayout from "../components/AppLayout";
import { Card, Input, Select  } from 'antd';
import { EditOutlined, UploadOutlined  } from '@ant-design/icons';
const { Meta } = Card;
const { Option } = Select;

const NewLook = () => {
    return(
        <AppLayout >
            <h1>New DailyLook</h1>
            
            <section >
            <Card
                style={{
                width: 280,
                position: 'fixed'
                }}
                cover={<img style={{height: 600}} alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
                actions={[
                    
                    <EditOutlined key="edit" />,
                    <UploadOutlined />
                    
                  ]}
             >
                <Meta description="Today's look" />
            </Card>
            
            <div style={{position: 'fixed', marginLeft: 300, textAlign:'center'}}>
                <ul>
                <li style={{display: 'inline-block'}}><h3 >데일리룩 제목</h3></li>
                <li style={{display: 'inline-block'}}><Input showCount maxLength={20} /></li>
                </ul>
                
                <ul>
                <li style={{display: 'inline-block'}}><h3 >카테고리 </h3></li>
                <li style={{display: 'inline-block'}}>
                <Select
                    showSearch
                    style={{
                    width: 200,
                    }}
                    placeholder="카테고리를 선택하세요."
                    optionFilterProp="children"
                    filterOption={(input, option) => option.children.includes(input)}
                    filterSort={(optionA, optionB) =>
                    optionA.children.toLowerCase().localeCompare(optionB.children.toLowerCase())
                    }
                >
                    <Option value="1">Not Identified</Option>
                    <Option value="2">Closed</Option>
                    <Option value="3">Communicated</Option>
                    <Option value="4">Identified</Option>
                    <Option value="5">Resolved</Option>
                    <Option value="6">Cancelled</Option>
                </Select>
                </li>
                </ul>
                </div>
            </section>
            <section >
                
                
            </section>
        </AppLayout>
    );
};

export default NewLook;
